import axios from "axios";
import {useEffect} from "react"
function App() {
  const fetchUsers = () => {
    return axios
      .get("https://restcountries.com/v2/all")
      .then((res) => console.log(res.data));
  };

  useEffect(() => {
    fetchUsers();
  }, []);

  return (
    <div className="App">
      <h1>hello world</h1>
    </div>
  );
}

export default App;
